function degree2Points(deg)
{
    if (deg >= 93 && deg <= 100) return 4;
    else if (deg >= 89 && deg <= 92) return 3.7;
    else if (deg >= 84 && deg <= 88) return 3.3;
    else if (deg >= 80 && deg <= 83) return 3;
    else if (deg >= 76 && deg <= 79) return 2.7;
    else if (deg >= 73 && deg <= 75) return 2.3;
    else if (deg >= 70 && deg <= 72) return 2;
    else if (deg >= 67 && deg <= 69) return 1.7;
    else if (deg >= 64 && deg <= 66) return 1.3;
    else if (deg >= 60 && deg <= 63) return 1;
    else if (deg < 60) return 0;
    else return 0; 

    }

function totalGPA() 
{
    var TotalGPA = 0, totalPoints = 0, totalHours = 0, totalCourses = 0, totalSemi = 0, totalearnedHour = 0;
    for(var i = 0 ; i <allTerms.length;i++)
    {
        document.getElementById("infoSem" + (i + 1)).innerHTML = "";
        var totpnts = 0, degree = 0 , pnt = 0 , totHours = 0 , hour =0 ,termGPA = 0 ;
        for(var s = 0 ; s <allTerms[i].length;s++)
        {
           
            degree = allTerms[i][s].degree;
            pnt = degree2Points(degree);
            totpnts += pnt;

            hour = allTerms[i][s].hours;
            totHours += hour;

            termGPA += (hour * pnt);
            if (pnt > 0) {
                totalCourses++; totalearnedHour += hour;
                //console.log( allTerms[i][s].fullname + "totH=" + hour + "pnt" + pnt);
            }
        }
      
        
        termGPA = termGPA / totHours;

        if (termGPA >= 0 && termGPA <= 4) {
            if (!isNaN(termGPA)) {
                if(termGPA != 0)  totalSemi++; 
                totalPoints += totpnts;
                totalHours += totHours;
                TotalGPA += termGPA;
                if (isNaN((TotalGPA / totalSemi))) TotalGPA = 0;
               // console.log("term " + (i + 1) + " gpa: " + termGPA);
                document.getElementById("infoSem" + (i + 1)).innerHTML = "GPA : " + termGPA.toFixed(2) + "</br> Hours : " + totHours;
                if (totHours > maxHours) { document.getElementById("infoSem" + (i + 1)).style.borderColor = "yellow"; /*alert("Semister" + (i + 1) + " hours = " + totHours + " maxHours :" + maxHours);*/} else document.getElementById("infoSem" + (i + 1)).style.borderColor = "white";
                document.getElementById('GPA').innerHTML = "Total GPA : " + (TotalGPA/totalSemi).toFixed(2) + "/4     ,       Total Hours : " + totalearnedHour + " / " + TotalCredit + "       ,       Total Points : " + totalPoints.toFixed(2) + "       ,       Total Coureses : " + totalCourses + " / " + allSUBs.length;
            }
        }
        
            
        
        
    }

    showNames();
}

